    "2015-07-16T21:37:22.569761",nt"name": "military-bases-national",nt"isopen":
    false,nt"url": null,nt"notes": "The dataset depicts the authoritative boundaries
    of the most commonly known Department of Defense (DoD) sites, installations, ranges,
    and training areas in the United States and Territories (NTAD 2015). These sites
    encompass land which is federally owned or otherwise managed. This dataset was created
    from source data provided by the four Military Service Component headquarters and
    was compiled by the Defense Installation Spatial Data Infrastructure (DISDI) Program
    within the Office of the Deputy Under Secretary of Defense for Installations and
    Environment, Business Enterprise Integration Directorate. Sites were selected from
    the 2010 Base Structure Report (BSR), a summary of the DoD Real Property Inventory.
    This list does not necessarily represent a comprehensive collection of all Department
    of Defense facilities, and only those in the fifty United States and US Territories
    were considered for inclusion. For inventory purposes, installations are comprised
    of sites, where a site is defined as a specific geographic location of federally
    owned or managed land and is assigned to military installation. DoD installations
    are commonly referred to as a base, camp, post, station, yard, center, homeport
    facility for any ship, or other activity under the jurisdiction, custody, control
    of the DoD.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
